Text:
@Camosix

Kenenkään ei tarvitse muutella tiedostoja .avi:ksi.

Lataa vain yllä mainittu VLC media player -ohjelma ja käytä sitä näiden videoiden katseluun. Myös useimmille puhelimille ja taulutietokoneille löytyy ohjelmia, joita voi käyttää tämän torrentin videotiedostojen (.flv, .mkv ja .avi) katseluun.
